import { Chart } from 'chart.js'
import React, { createContext } from 'react'

const AnalysisChart = () => {

    let ctx = document.querySelector('.analysis__chart')[0]

    let data = {
        datasets: [{
            data: [10, 20, 30]
        }]
    }

    let demoChart = new Chart(createContext, {
        type: 'doughnut',
        data: data
    })

    return (
        <canvas
        className="analysis__chart"
        width="600"
        height="600"
        ></canvas>
    )
}

export default AnalysisChart
